Scent: Eternal Musk | Vibrant and with a distinct woody note softened by delicate floral touches.

Lasts approximately: 45 hours.

INSTRUCTIONS FOR USE

- Always place the candle on heat-resistant surfaces away from heaters or other hot surfaces.
- Do not light the candle in rooms with children or pets.
- Always keep the lit candle in a vertical position so that the wax burns evenly. When you snuff it out, allow the wax to cool before using it again.
- Keep the wick cut to 0.4" above the wax for optimum burning.
- Keep the wax clear of residue.
- Always keep the candle away from curtains, ventilation, and air vents. If you use more than one candle at a time, leave a space of 3.9" between them.
- Snuff out the candle after 4 hours of uninterrupted use and never leave it unattended while burning. Always use a candle snuffer.
- Snuff out the candle before it is completely used, always leaving at least 0.4" of wax.

Notes:
Top notes: bergamot and violet.
Heart note: vetiver.
